import { useNavigate } from 'react-router-dom';

const { SubMenu } = Menu;

const items = [
  {
    label: "Görevler",
    key: 'task',
    icon: <FileTextOutlined />
  },
  {
    label: "Takvim",
    key: 'calendar',
    icon: <CalendarOutlined />
  },
  {
    label: 'Mail',
    key: 'mail',
    icon: <MailOutlined />,
  },
  {
    key: 'app',
    avatar: <Avatar size={35} icon={<UserOutlined />} />,
    children: [
      {
        label: 'Profil Düzenle',
        key: 'setting:1',
        icon: <SettingOutlined />,
      },

    ],
  },
];

const Home = () => {
  const [current, setCurrent] = useState(''); // Set a default selected key
  const navigate = useNavigate();

  const handleClick = (e) => {
    console.log('click ', e);
    setCurrent(e.key);
  };

  const handleLogout = () => {
    navigate(-1); // Navigate to previous page or perform logout action
  };

  return (

      <div style={{marginLeft:"20px"}}>
        <h2>Home Page</h2>
        <p>Welcome to the Home Page!</p>
      </div>


  );
};

export default Home;
